// import photo8 from './roll_1/398049_0031.jpg';
// import photo8 from './roll_1/398049_0033.jpg';
// import photo8 from './roll_1/398049_0034.jpg';
// import photo8 from './roll_1/398049_0035.jpg';

export default class HomePhotos extends React.Component {
  render () {

    return (
        <div className="container">
            <div className="row">
                <div className="col-sm">
                    <img src={photo1}></img>
                </div>
                <div className="col-sm">
                    <img src={photo2}></img>
                </div>
                <div className="col-sm">
                    <img src={photo3}></img>
                </div>
                <div className="col-sm">
                    <img src={photo4}></img>
                </div>
                <div className="col-sm">
                    <img src={photo5}></img>
                </div>
                <div className="col-sm">
                    <img src={photo6}></img>
                </div>
                <div className="col-sm">
                    <img src={photo7}></img>
                </div>
            </div>
            <div className="row">
            <div className="col-sm">
                    <img src={photo8}></img>
                </div>
                <div className="col-sm">
                    <img src={photo9}></img>
                </div>
                <div className="col-sm">
                    <img src={photo10}></img>
                </div>
                <div className="col-sm">
                    <img src={photo11}></img>
                </div>
                <div className="col-sm">
                    <img src={photo12}></img>
                </div>
                <div className="col-sm">
                    <img src={photo13}></img>
                </div>
                <div className="col-sm">
                    <img src={photo14}></img>
                </div>
            </div>

        </div>
    )
  }
}
